import { useRef, RefObject, useEffect } from 'react'

import rocket from '../public/rocket.jpg'

const blob =
	'data:image/jpeg;base64,'

export type CanvasProps = {
	containerRef: RefObject<HTMLDivElement>
} & React.HTMLAttributes<HTMLCanvasElement>

function Canvas({ containerRef, ...props }: CanvasProps) {
	const canvasRef = useRef<HTMLCanvasElement>(null)
	useEffect(() => {
		let frameCount = 0
		let animationFrameId: number
		if (containerRef.current && canvasRef.current) {
			const size = containerRef.current.getBoundingClientRect()
			const w = size.width
			const h = Math.floor(size.height)
			canvasRef.current.width = w
			canvasRef.current.height = h
			const ctx = canvasRef.current.getContext('2d')
			if (ctx) {
				const img = new Image()
				img.src = blob
				ctx.drawImage(img, (w - rocket.width) / 2, (h - rocket.height) / 2)
				const pixels = ctx.getImageData(0, 0, w, h)
				ctx.clearRect(0, 0, w, h)
				const image: string[] = []
				for (let y = 0; y < h; y++)
					for (let x = 0; x < w; x++)
						image[x + y * w] = `rgb(${pixels.data[y * 4 * pixels.width + x * 4]}, ${pixels.data[y * 4 * pixels.width + x * 4 + 1]}, ${
							pixels.data[y * 4 * pixels.width + x * 4 + 2]
						})`
				const draw = (frameCount: number) => {
					ctx.clearRect(0, 0, w, h)
					for (let y = 0; y < h; y++)
						for (let x = 0; x < w; x++) {
							ctx.fillStyle = image[x + y * w]
							ctx.fillRect(x, y, 1, 1)
						}
				}
				const render = () => {
					frameCount++
					draw(frameCount)
					animationFrameId = window.requestAnimationFrame(render)
				}
				render()
			}
		}
		return () => {
			window.cancelAnimationFrame(animationFrameId)
		}
	}, [containerRef, canvasRef])
	return <canvas ref={canvasRef} {...props}></canvas>
}

export default Canvas
